import { SIGNED_OUT as SET_AUTHENTICATED, SIGNED_IN } from "../actions/types";

const auth = false;

// eslint-disable-next-line import/no-anonymous-default-export
export default function (state = auth, action) {
  console.log(action);
  switch (action.type) {
    case SIGNED_IN:
      return !state;
    case SET_AUTHENTICATED:
        return !state;
    default:
      return state;
  }
}
